import React from "react";

class DataTable extends React.Component {
    constructor(props) {
        super(props);

    }

    render() {
        return (
            <div className="list_contents_table">
                <table id="dataTable" className="table_style">
                    <thead>
                    <tr>
                        <th>SN</th>
                        <th>Model</th>
                        <th>Site</th>
                        <th>Company</th>
                        <th>KPI</th>
                        <th>Header</th>
                        <th>State</th>
                        <th> Enter</th>
                    </tr>
                    </thead>
                </table>
                <div>
                </div>
            </div>
        );
    }
}

export default DataTable;
